  '1975#Viking 1 Lander (USA)#Landed successfully, operated for more than 6 years.  Returned extensive science results.#NASA Landers',
  '1975#Viking 2 Lander (USA)#Landed successfully, operated for more than 3.5 years.  Returned extensive science results.#NASA Landers',
  '1996#Mars Pathfinder Rover (USA)#Landed successfully, operated for just under 3 months.#NASA Rovers',
  '1999#Mars Polar Lander (USA)#Failed.  Crashed just prior to landing due to premature engine shutdown.#NASA Landers',
